import { useState } from "react";
import Nav from "../components/Nav";

const OnBoarding = () => {
  const [formData, setFormData] = useState({
    user_id: "",
    first_name: "",
    dob_day: "",
    dob_month: "",
    dob_year: "",
    show_status: false,
    status_identity: "single",
    status_interest: "relationship",
    email: "",
    url: "",
    about: "",
    matches: [],
  });

  const handleSubmit = (e) => {
    console.log("submitted");
  };

  const handleChange = (e) => {
    console.log("e", e);
    const value = e.target.value;
    const name = e.target.name;
    console.log("value" + value, "name" + name);

    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  console.log(formData);

  return (
    <>
      <Nav
        minimal={true}
        setShowModal={() => {}}
        showModal={false}
        setIsSignUp={false}
      />
      <div className="onboarding">
        <h2>Create ACOONT</h2>

        <form onSubmit={handleSubmit}>
          <section>
            <label htmlFor="first_name">First Name</label>
            <input
              id="first_name"
              type="text"
              name="first_name"
              placeholder="First Name"
              required={true}
              value={formData.first_name}
              onChange={handleChange}
            />

            <label>Birthday</label>
            <div className="multiple-input-container">
              <input
                id="dob_day"
                type="number"
                name="dob_day"
                placeholder="DD"
                required={true}
                value={formData.dob_day}
                onChange={handleChange}
              />

              <input
                id="dob_month"
                type="number"
                name="dob_month"
                placeholder="MM"
                required={true}
                value={formData.dob_month}
                onChange={handleChange}
              />

              <input
                id="dob_year"
                type="number"
                name="dob_year"
                placeholder="YYYY"
                required={true}
                value={formData.dob_year}
                onChange={handleChange}
              />
            </div>
            <label>Status</label>

            <div className="multiple-input-container">
              <input
                id="single"
                type="radio"
                name="status_identity"
                value="single"
                onChange={handleChange}
                checked={false}
              />
              <label htmlFor="single">Single</label>
              <input
                id="relationship"
                type="radio"
                name="status_identity"
                value="relationship"
                onChange={handleChange}
                checked={true}
              />
              <label htmlFor="relationship">In a relationship</label>
            </div>

            <label htmlFor="show-status">Show Status on my Profile</label>

            <input
              id="show-status"
              type="checkbox"
              name="show_status"
              onChange={handleChange}
              checked=""
            />

            <label>Show Me</label>

            <div className="multiple-input-container">
              <input
                id="single-interest"
                type="radio"
                name="status_interest"
                value="man"
                onChange={handleChange}
                checked={false}
              />
              <label htmlFor="single-interest">Single</label>
              <input
                id="relationship-interest"
                type="radio"
                name="status_interest"
                value="relationship"
                onChange={handleChange}
                checked={false}
              />
              <label htmlFor="relationship-interest">In a relationship</label>
              <input
                id="everyone-interest"
                type="radio"
                name="everyone_interest"
                value="everyone"
                onChange={handleChange}
                checked={false}
              />
              <label htmlFor="everyone-interest">Everyone</label>
            </div>

            <label htmlFor="about">About me</label>
            <input
              id="about"
              type="text"
              name="about"
              required={true}
              placeholder="I like long walks..."
              value={formData.about}
              onChange={handleChange}
            />

            <input type="submit" />
          </section>

          <section>
            <label htmlFor="url">Profile Photo</label>
            <input
              type="url"
              name="url"
              id="url"
              onChange={handleChange}
              required={true}
            />
            <div className="photo-container">
              {false && <img src={formData.url} alt="profile pic preview" />}
            </div>
          </section>
        </form>
      </div>
    </>
  );
};

export default OnBoarding;
